import Vue from "vue";
import App from "./App.vue";
import router from "@/router";
import HVuetabs from 'h-vue-tabs';
import { createApp } from 'vue'
Vue.config.productionTip = false;
const app = createApp(MyApp)
app.use(HVuetabs);
new Vue({
  router,
  render: (h) => h(App)
}).$mount("#app");
